import { suggestionRequest } from "features/suggestion/reducer/suggestionSlice"
// useEffect 참고 https://xiubindev.tistory.com/100

const SuggestionOne = () => {
  const suggestionData = [
    {
    "suggestion_id": 11,
    "user_id": 1,
    "contents": "강남역 약속",
    "location": "강남역",
    "routine": [
        "목","금"
    ],
    "start": [
        "2021-12-23",
        "2021-12-24"
    ],
    "end": null,
    "classification": null,
    "type": "ROUTINE"
  },
  {
  "suggestion_id": 13,
  "user_id": 1,
  "contents": "일정 있을걸?",
  "location": null,
  "routine": null,
  "start": "2021-12-23",
  "end": null,
  "classification": "DEV",
  "type": "SUGGESTION"
}, 
{
"suggestion_id": 13,
"user_id": 1,
"contents": "크리스마스",
"location": null,
"routine": null,
"start": "2021-12-25",
"end": "2021-12-25",
"classification": "DEV",
"type": "SUGGESTION"
}
]
const dispatch = useDispatch()

useEffect(() => {
  dispatch(suggestionRequest({
    user_id: 1,
  }))
}, []);

// useEffect(() => {
//   dispatch(suggestionRequest({
//     user_id: user_id,
//   }))
// }, [user_id]);


  return (
    <div className='team-area'>
        <div className="">
          {suggestionData.map((single, key) => {
              return (
                <SuggestionOneSingle
                  data={single}
                  key={key}
                />
              );
            })}
        </div>
      </div>

  );
};

export default SuggestionOne;
